import React, {Component} from 'react'

interface Props{

}

interface State{
    disable : boolean[]
}

class Menu extends Component<Props,State>{
    constructor(props:Props){
        super(props);
        this.state = {
            disable : [true,false,false]
        }
    }

    style(item:boolean){
        return item? "menuItem-selected" : "menuItem"
    }

    private main(){
        return(
            <div className='menu'>
                <div>Главная</div>
                <div>Мои курсовые</div>
                <div>Свободные курсовые</div>
            </div>
        )
    };

    render(){
        return this.main();
    }
}

export default Menu
